  true,\n\t\"url\": null,\n\t\"notes\": \"Louisiana's Cultural Products Districts
  provide for tax free sales of original works of visual art, as well as tax credits
  for commercial and residential renovation within the specified district. The primary
  goal of this initiative is to spark community revitalization based on cultural activity
  though tax incentives. This dataset depicts boundaries, as of October 2012, for
  the 21 Cultural Products Districts within the City of New Orelans. This dataset
  is designed to be used in conjunction with the City of New Orleans 'Parcel' and
  'Address' data to identify eligible properties. For specific information on eligibility,
  please contact the City of New Orelans Cultural Economy Project Coordinator. Update:
